class TreeNode:
    def __init__(self, val=0, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right
    def __repr__(self):
        return '[{}-{}-{}]'.format(
            'x' if self.left is None else self.left,
            self.val,
            'x' if self.right is None else self.right)
    def __eq__(self, __value: object) -> bool:
        if __value is None:
            return False
        return self.val == __value.val and self.left == __value.left and self.right == __value.right
