# @lc code=start
# Definition for a binary tree node.
# class TreeNode:
#     def __init__(self, val=0, left=None, right=None):
#         self.val = val
#         self.left = left
#         self.right = right
from typing import Optional

BOUND = 40001

class Solution:
    def maxSumBST(self, root: Optional[TreeNode]) -> int:
        assert root is not None
        _, _, sx, _, _  = self.traverse(root)
        return sx
        
    def traverse(self, root):
        assert root is not None
        # print('---------------')
        # print_tree(root)
        is_bst = True
        ls = 0
        rs = 0
        lsx = 0
        rsx = 0
        if root.left is None:
            lo = root.val
        else:
            lb, ls, lsx, llo, lhi = self.traverse(root.left)
            if not lb or lhi >= root.val:
                is_bst = False
            lo = llo
        if root.right is None:
            hi = root.val
        else:
            rb, rs, rsx, rlo, rhi = self.traverse(root.right)
            if not rb or rlo <= root.val:
                is_bst = False
            hi = rhi

        s = ls + rs + root.val
        if is_bst:
            sx = max(lsx, rsx, s)
        else:
            sx = max(0, lsx, rsx)
        # print('...............')
        r = is_bst, s, sx, lo, hi
        # print(r)
        return r

def print_tree(node: Optional[TreeNode], indent = 0):
    if node is None:
        return
    prefix = '  ' * indent
    print_tree(node.right, indent + 1)
    print(prefix, node.val)
    print_tree(node.left, indent + 1)

