from test_utils import run_test, null

def to_tree(lst):
    root = TreeNode(lst[0])
    index = 0
    q = [root]
    while len(q) > 0:
        nq = []
        for node in q:
            if index + 1 < len(lst) and lst[index + 1] is not None:
                node.left = TreeNode(lst[index + 1])
                nq.append(node.left)
            if index + 2 < len(lst) and lst[index + 2] is not None:
                node.right = TreeNode(lst[index + 2])
                nq.append(node.right)
            index += 2
        q = nq
    return root

